import React from 'react';
import logo from '../img/logo.png';

const Footer = () => {
    return (
        <footer>
            <img src={logo} alt="" />
            <span>
                Trying this tutorial <b>Kumar Sashank</b>
            </span>
        </footer>
    );
}

export default Footer;
